function createCanvasForCluster(node, containerElement, projection) {

    var bins = forceNodesForCluster(node, projection);

    var sim = simulateWithBins(bins);

    var canvas = d3.select(containerElement).style("position", "absolute").style("left", sim.offset.x - 8 + "px").style("top", sim.offset.y - 8 + "px").append("canvas").attr('width', sim.width).attr('height', sim.height);

    drawForceCirclesOnto(sim.c, canvas.node(), sim.offset);
}

function forceNodesForCluster(node, projection) {

    var bins = {};
    var i = node.data_rows.length - 1;
    while (i >= 0) {
        var n = node.data_rows[i];

        var latLng = new google.maps.LatLng(node.data_src[n][LATVAL], node.data_src[n][LONVAL]);
        var proj = projection.fromLatLngToContainerPixel(latLng);

        var x_ind = Math.floor(proj.x / BOX_SIZE);
        var y_ind = Math.floor(proj.y / BOX_SIZE);

        if (!(x_ind in bins)) {
            bins[x_ind] = {};
        }
        if (!(y_ind in bins[x_ind])) {
            bins[x_ind][y_ind] = [];
        }

        bins[x_ind][y_ind].push({
            x: proj.x,
            dx: proj.x,
            y: proj.y,
            dy: proj.y,
            data_row: n
        });

        i--;
    }

    return bins;
}

function simulateWithBins(bins) {
    //add heuristic here to pick correct bins

    var circles = [];
    var x_min = Number.MAX_VALUE;
    var x_max = Number.MIN_VALUE;
    var y_min = Number.MAX_VALUE;
    var y_max = Number.MIN_VALUE;
    for (var x in bins) {
        for (var y in bins[x]) {

            //take off the top for now
            var n = bins[x][y].pop();
            //n['r'] = CIRCLE_SIZE;

            x_min = Math.min(x_min, n.x);
            x_max = Math.max(x_max, n.x);
            y_min = Math.min(y_min, n.y);
            y_max = Math.max(y_max, n.y);

            circles.push(n);
        }
    }

    var model = d3.forceSimulation()
    //.alphaDecay(0.1)
    //.force("fx",d3.forceX(function(d) {return(d.dx);}).strength(0.05))
    //.force("fy",d3.forceY(function(d) {return(d.dy);}).strength(0.05))
    .force("collideForce", d3.forceCollide(function () {
        return CIRCLE_SIZE;
    }).strength(1).iterations(5)).nodes(circles).stop();

    var iters = 0;
    while (iters < 10) {
        model.tick();
        iters++;
    }
    model.stop();

    return { c: circles,
        offset: { x: x_min - 8, y: y_min - 8 },
        width: x_max - x_min + 16,
        height: y_max - y_min + 16 };
}

function drawForceCirclesOnto(circles, canvas, offset) {

    var i = circles.length - 1;
    while (i >= 0) {
        var c = circles[i];
        var ctx = canvas.getContext("2d");
        ctx.beginPath();
        ctx.arc(parseInt(c.x - offset.x), parseInt(c.y - offset.y), CIRCLE_SIZE, 0, 2 * Math.PI);
        ctx.stroke();

        i--;
    }
}

